/*Table structure for table `app_etp_user` */

CREATE TABLE `app_etp_user` (
  `id` bigint(20) unsigned NOT NULL COMMENT '主键',
  `name` varchar(255) NOT NULL COMMENT '企业名称',
  `credit_code` varchar(20) NOT NULL COMMENT '社会统一信用代码',
  `etp_type` int(1) NOT NULL COMMENT '企业类型：合资=1、独资=2、国有=3、私营=4、全民所有制=5、集体所有制=6、股份制=7、有限责任=8',
  `legal_person` varchar(255) NOT NULL COMMENT '法人',
  `legal_person_no` varchar(255) NOT NULL COMMENT '法人身份证',
  `registered_capital` bigint(20) DEFAULT NULL COMMENT '注册资本（人民币/分）',
  `registered_time` varchar(20) DEFAULT NULL COMMENT '注册时间 格式yyyy-MM-dd',
  `contacts` varchar(255) NOT NULL COMMENT '联系人',
  `contacts_phone` varchar(11) NOT NULL COMMENT '联系人电话',
  `contacts_email` varchar(1024) DEFAULT NULL COMMENT '联系人邮箱',
  `industry` varchar(255) DEFAULT NULL COMMENT '所处行业',
  `industry_code` varchar(20) DEFAULT NULL COMMENT '所处行业编码',
  `company_size` int(1) DEFAULT NULL COMMENT '公司规模：1-20人以下，2-20至50人，3-50至99人，4-90至200人，5-200至500人，6-500至1000人，7-1000人及以上',
  `operating_years` int(1) DEFAULT NULL COMMENT '经营年限：1-1年以下，2-1年，3-2年，4-3至5年，5-5年以上',
  `average_month_salary` bigint(20) DEFAULT NULL COMMENT '公司月均薪酬（人民币/分）',
  `province` varchar(255) DEFAULT NULL COMMENT '省',
  `city` varchar(255) DEFAULT NULL COMMENT '市',
  `area` varchar(255) DEFAULT NULL COMMENT '区',
  `region_code` varchar(6) DEFAULT NULL COMMENT '区域代码',
  `address` varchar(1024) DEFAULT NULL COMMENT '公司地址',
  `business_scope` text COMMENT '经营范围',
  `customer_manager` bigint(20) NOT NULL COMMENT '客户经理',
  `last_customer_manager` bigint(20) NOT NULL COMMENT '上任客户经理',
  `source` varchar(255) NOT NULL COMMENT '来源',
  `creator` bigint(20) NOT NULL COMMENT '创建人',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modifier` bigint(20) NOT NULL COMMENT '修改人(id)',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_credit_code` (`credit_code`),
  KEY `idx_create_time` (`create_time`),
  KEY `idx_update_time` (`update_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='企业客户表';

