  `mobile` varchar(11) NOT NULL COMMENT '手机号,11位数字',
  `gender` tinyint(2) unsigned DEFAULT NULL COMMENT '性别：-1-未知，0-女，1-男',
  `marital_status` tinyint(2) DEFAULT NULL COMMENT '婚姻状态：-1-离异，0-未婚，1-已婚',
  `email` varchar(255) DEFAULT NULL COMMENT '邮箱',
  `highest_education` tinyint(2) DEFAULT NULL COMMENT '最高学历:大学及以上=1,大专=2,中专=3,高中=4,其他=5',
  `highest_degree` tinyint(2) DEFAULT NULL COMMENT '最高学位:博士=1,硕士=2;学士=3,高中=4,其他=5',
  `province` varchar(255) DEFAULT NULL COMMENT '省',
  `city` varchar(255) DEFAULT NULL COMMENT '市',
  `area` varchar(255) DEFAULT NULL COMMENT '区',
  `region_code` varchar(6) DEFAULT NULL COMMENT '区划编码',
  `address` varchar(1024) DEFAULT NULL COMMENT '具体地址',
  `avatar` varchar(2048) DEFAULT NULL COMMENT '头像,url',
  `last_customer_manager` bigint(20) NOT NULL COMMENT '上任客户经理',
  PRIMARY KEY (`id`),
  KEY `idx_create_time` (`create_time`),
  KEY `idx_update_time` (`update_time`),
  KEY `idx_customer_manager` (`customer_manager`),
  KEY `idx_source` (`source`),
  KEY `idx_mobile_and_certificate_no` (`mobile`,`certificate_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='个人用户基础信息';

