/*Table structure for table `app_user_family` */

CREATE TABLE `app_user_family` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
