  `family_member` varchar(255) DEFAULT NULL COMMENT '其他家庭成员',
  `family_member_mobile` varchar(11) DEFAULT NULL COMMENT '家庭成员联系方式',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='个人客户家庭信息';

