/*Table structure for table `sys_department` */

CREATE TABLE `sys_department` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '父级部门id',
  `name` varchar(128) DEFAULT NULL COMMENT '部门名称',
  `short_name` varchar(128) DEFAULT NULL COMMENT '部门简称',
  `level` int(1) DEFAULT NULL COMMENT '层级',
  `status` int(1) DEFAULT '1' COMMENT '状态（-1-删除，0-禁用，1-启用）',
  `creator` bigint(20) NOT NULL COMMENT '创建人',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `modifier` bigint(20) NOT NULL COMMENT '修改人（id）',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统部门信息 ';

