/*Table structure for table `sys_user` */

CREATE TABLE `sys_user` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `account` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '员工账号',
  `password` varchar(100) NOT NULL COMMENT '密码',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '员工姓名',
  `mobile` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '手机号码',
  `gender` int(1) DEFAULT NULL COMMENT '性别',
  `dept_id` bigint(20) DEFAULT NULL COMMENT '所属部门',
  `job` varchar(100) DEFAULT NULL COMMENT '岗位',
  `job_rank` varchar(100) DEFAULT NULL COMMENT '职级',
  `status` int(1) NOT NULL DEFAULT '1' COMMENT '状态（-1-删除，0-禁用，1-启用）',
  `creator` bigint(20) NOT NULL COMMENT '创建人（id）',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `modifier` bigint(20) NOT NULL COMMENT '修改人（id）',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `view_authority` tinyint(2) NOT NULL DEFAULT '1' COMMENT '查看权限,1=都可以查看,2=仅自己,3=仅本部门',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `account_unique` (`account`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='系统用户表';

